import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import OldApp from "./OldVersion/OldApp";
import DisplayCalendar from "./OldVersion/Components/Calendar";
import FilteredView from "./OldVersion/FilteredView";
import MaterialAccordion from "./OldVersion/Components/MaterialAccordion";
import Typography from "@material-ui/core/Typography";
import Breadcrumbs from "@material-ui/core/Breadcrumbs";
import * as UILink from "@material-ui/core/Link";

// This site has 3 pages, all of which are rendered
// dynamically in the browser (not server rendered).
//
// Although the page does not ever refresh, notice how
// React Router keeps the URL up to date as you navigate
// through the site. This preserves the browser history,
// making sure things like the back button and bookmarks
// work properly.

export default function Navigation() {
  return (
    <Router>
      {/* <Breadcrumbs aria-label="breadcrumb" className="text-center">
        <Link to="/">Home</Link>
        <Link to="/calendar">Calendar</Link>
        <Link to="/filteredview">Filtered view</Link>
      </Breadcrumbs> */}
      <div className="container">
        <div className="row">
          <div className="col-3">
            <Link to="/">Home</Link>
          </div>
          <div className="col-3">
            <Link to="/calendar">Calendar</Link>
          </div>
          <div className="col-3">
            <Link to="/filteredview">Filtered view</Link>
          </div>
          <div className="col-3">
            <Link to="/accordion">accordion</Link>
          </div>
        </div>
        {/* <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/calendar">Calendar</Link>
          </li>
          <li>
            <Link to="/filteredview">Filtered view</Link>
          </li>
        </ul> */}

        <hr />

        {/*
          A <Switch> looks through all its children <Route>
          elements and renders the first one whose path
          matches the current URL. Use a <Switch> any time
          you have multiple routes, but you want only one
          of them to render at a time
        */}
        <Switch>
          <Route exact path="/" component={OldApp} />

          <Route path="/calendar" component={DisplayCalendar} />

          <Route path="/filteredview" component={FilteredView} />
          <Route path="/accordion" component={MaterialAccordion} />
        </Switch>
      </div>
    </Router>
  );
}

// You can think of these components as "pages"
// in your app.

function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}

function About() {
  return (
    <div>
      <h2>About</h2>
    </div>
  );
}

function Dashboard() {
  return (
    <div>
      <h2>Dashboard</h2>
    </div>
  );
}
